        public static int LengthOfLongestSubstring(string s)
        {
            int n = s.Length;
            int ans = 0;
            Dictionary<int,int> ht = new Dictionary<int, int>();          
            for (int j = 0, i = 0; j < n; j++)
            {
                if (ht.ContainsKey(s.ElementAt(j)))
                {
                    i = Math.Max(ht[s.ElementAt(j)], i);
                    ht[s.ElementAt(j)] = j + 1;
                    //ht.Remove(s.ElementAt(j));                      
                }
                ans = Math.Max(ans, j - i + 1);
                ht.TryAdd(s.ElementAt(j), j + 1);
            }

            return ans;
        }

            public int MaxArea(int[] height)
            {
                int maxarea = 0;
                for (int i = 0; i < height.Length; i++)
                    for (int j = i + 1; j < height.Length; j++)
                        maxarea = Math.Max(maxarea, Math.Min(height[i], height[j]) * (j - i));
                return maxarea;
            }

        public int MaxAreaWay2(int[] height)
        {
            int maxarea = 0, l = 0, r = height.Length - 1;
            while (l < r)
            {
                maxarea = Math.Max(maxarea, Math.Min(height[l], height[r]) * (r - l));
                if (height[l] < height[r])
                    l++;
                else
                    r--;
            }
            return maxarea;
        }


        public string IntToRoman(int num)
        {
            int[] values = new int[] { 1000, 900, 500, 400, 100, 90, 50, 40, 10, 9, 5, 4, 1 };
            string[] strs = new string[] { "M", "CM", "D", "CD", "C", "XC", "L", "XL", "X", "IX", "V", "IV", "I" };

            string str = "";
            for (int i=0; i<13; i++)
            {
                while (num >= values[i])
                {
                    num -= values[i];
                    str += strs[i];
                }
            }
            return str;
        }

        public void Rotate(int[][] matrix)
        {
            int n = matrix.Length;
            // 上下翻转
            for (int i = 0; i < n / 2; i++)
            {
                for (int j = 0; j < n; j++)
                {
                    int tmp = matrix[i][j];
                    matrix[i][j] = matrix[n - i - 1][j];
                    matrix[n - i - 1][j] = tmp;
                }
            }
            // 对角翻转
            for (int i = 0; i < n; i++)
            {
                for (int j = i + 1; j < n; j++)
                {
                    int tmp = matrix[i][j];
                    matrix[i][j] = matrix[j][i];
                    matrix[j][i] = tmp;
                }
            }
        }

        public int[] TwoSum_1(int[] nums, int target)
        {
            for (int i = 0; i < nums.Length; i++)
            {
                for (int j = i + 1; j < nums.Length; j++)
                {
                    if (nums[j] == target - nums[i])
                    {
                        return new int[] { i, j };
                    }
                }
            }
            throw new ArgumentException("No two sum solution");
        }

        public int[] twoSum(int[] nums, int target)
        {
            Dictionary<int,int> ht = new Dictionary<int,int>();
            for (int i = 0; i < nums.Length; i++)
            {
                ht.Add(nums[i], i);
            }
            for (int i = 0; i < nums.Length; i++)
            {
                int complement = target - nums[i];
                if (ht.ContainsKey(complement) && ht[complement]!=i)
                {
                    return new int[] { i, ht[complement] };
                }
            }
            throw new ArgumentException("No two sum solution");
        }


        public void nextPermutation(int[] nums)
        {
            int i = nums.Length - 2;
            while (i >= 0 && nums[i + 1] <= nums[i])
            {
                i--;
            }
            if (i >= 0)
            {
                int j = nums.Length - 1;
                while (j >= 0 && nums[j] <= nums[i])
                {
                    j--;
                }
                swap(nums, i, j);
            }
            reverse(nums, i + 1);
        }

        private void reverse(int[] nums, int start)
        {
            int i = start, j = nums.Length - 1;
            while (i < j)
            {
                swap(nums, i, j);
                i++;
                j--;
            }
        }

        

